insert  into `product_home`(`id`,`home_name`,`title_img`,`introduction`,`content`,`address`,`type`,`supporting_facilities`,`create_time`,`is_display`,`is_delete`) values (1,'郑州金水区金色家园-一号试点','/files/78240598-3c16-4505-af11-e6faa680ed3b.jpg','这是一个家园试点,对对对','<p><br/></p><p><span style=\"font-family: 微软雅黑; text-indent: 32px;\">郑州市老年公寓是郑州市民政局投资兴办的一所社会养老机构，属公办公营养老院，位于郑州市航海西路7号，总建筑面积11166.76平方米，配有中央空调、电梯、电视、电话、紧急呼叫系统、无障碍设施，24小时供应热水。公寓有床位300张，楼宇清新宁静，房间典雅舒适，设有单间、标准间、多人间、套房等多种户型，配有健身房、棋牌娱乐室、电脑室、教室、图书阅览室、休闲花园、户外健身园地等设施。公寓与郑州市瑞阳老年病医院开展深度医养结合，入住老人不出门就可以解决就医问题，并且可以按照省市医保规定使用医保卡报销，公寓与郑州市第一人民医院、郑州市第二人民医院都有共建联系，实行就医绿色通道和大病困难补助等诸多优惠政策；公寓社工科定期开展健康大课堂、文艺演出、兴趣小组、志愿者服务等丰富多彩的娱乐活动，让老人们精神上更加的快乐。我们秉承“老人至上、服务一流”的服务宗旨，根据不同的护理级别提供全方位、多元化的优质服务，为老年人提供颐养天年的好去处。地址：郑州市航海西路7号，热线电话：0371-65319289。</span><br/></p><p style=\"text-align:center\"><img src=\"http://127.0.0.1:7070/files/20190920/5b95e6b69c4441b3bd2c2471ce132899.jpg\" title=\"5b95e6b69c4441b3bd2c2471ce132899.jpg\" alt=\"tup11.jpg\" width=\"557\" height=\"309\" style=\"width: 557px; height: 309px;\"/></p>','郑州市金水区未来路88号',0,NULL,NULL,NULL,NULL),(2,'金色家园试点单之•郑州市老年公寓','/files/93eb84e6-a683-4a40-9e61-a9d3f2f1eab1.jpg','郑州市老年公寓是郑州市民政局投资兴办的一所社会养老机构，属公办公营养老院，位于郑州市航海西路7号，总建筑面积11166.76平方米，配有中央空调、电梯、电视、电话、紧急呼叫系统、无障碍设施，24小时供应热水。公寓有床位300张，楼宇清新宁静，房间典雅舒适，设有单间、标准间、多人间、套房等多种户型，配有健身房、棋牌娱乐室、电脑室、教室、图书阅览室、休闲花园、户外健身园地等设施。公寓与郑州市瑞阳老年病医院开展深度医养结合，入住老人不出门就可以解决就医问题','<p style=\"text-align: left;\"><span style=\"font-family: 微软雅黑; text-indent: 32px;\">郑州市老年公寓是郑州市民政局投资兴办的一所社会养老机构，属公办公营养老院，位于郑州市航海西路7号，总建筑面积11166.76平方米，配有中央空调、电梯、电视、电话、紧急呼叫系统、无障碍设施，24小时供应热水。公寓有床位300张，楼宇清新宁静，房间典雅舒适，设有单间、标准间、多人间、套房等多种户型，配有健身房、棋牌娱乐室、电脑室、教室、图书阅览室、休闲花园、户外健身园地等设施。公寓与郑州市瑞阳老年病医院开展深度医养结合，入住老人不出门就可以解决就医问题，并且可以按照省市医保规定使用医保卡报销，公寓与郑州市第一人民医院、郑州市第二人民医院都有共建联系，实行就医绿色通道和大病困难补助等诸多优惠政策；公寓社工科定期开展健康大课堂、文艺演出、兴趣小组、志愿者服务等丰富多彩的娱乐活动，让老人们精神上更加的快乐。我们秉承“老人至上、服务一流”的服务宗旨，根据不同的护理级别提供全方位、多元化的优质服务，为老年人提供颐养天年的好去处。地址：郑州市航海西路7号，热线电话：0371-65319289。</span><br/></p><p style=\"text-align:center\"><img src=\"http://127.0.0.1:7070/files/20190920/4b4aa46d3cb94d508acf4ccdf8b12db6.jpg\" title=\"4b4aa46d3cb94d508acf4ccdf8b12db6.jpg\" alt=\"9.jpg\" width=\"659\" height=\"401\" style=\"width: 659px; height: 401px;\"/></p>','郑州市金水区花园路',0,NULL,'2019-09-20 07:17:35',1,0);

/*Table structure for table `project_server` */

DROP TABLE IF EXISTS `project_server`;

CREATE TABLE `project_server` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '自增编号',
  `serve_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '名称',
  `title_name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '标题',
  `server_content` text COLLATE utf8_bin COMMENT '内容介绍',
  `title_name1` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '标题1',
  `url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '跳转链接',
  `sort` int(20) DEFAULT NULL COMMENT '排序',
  `server_content1` text COLLATE utf8_bin COMMENT '内容介绍1',
  `server_title_image` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '封面图',
  `introduce` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '简介',
  `type` int(20) DEFAULT NULL COMMENT '类型 1:文章 2:视频',
  `is_disable` int(20) DEFAULT NULL COMMENT '是否有效',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `is_delete` int(20) DEFAULT NULL COMMENT '是否删除 0:否 1:是',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='服务项目';

/*Data for the table `project_server` */

insert  into `project_server`(`id`,`serve_name`,`title_name`,`server_content`,`title_name1`,`url`,`sort`,`server_content1`,`server_title_image`,`introduce`,`type`,`is_disable`,`create_time`,`is_delete`) values (1,'金色家园','金色家园','“金色家园”倡导利用公共和社会资源，建设集居住生活、学习娱乐、活动健身、康复医疗为一体的乐养、学养、动养、医养相结合的综合性养老场所。其有改建和新建两种形式。 改建的“金色家园”，是对社会已有的养老场所进行规范，或对以服务老同志为主的医院、疗养院、闲置场所等进行改造和完善，使其达到金色家园标准。 新建的“金色家园”，设置有健康生活、康复照料和特殊关爱等多项功能，也可根据实际条件酌情设置，但至少要具备其中一项功能，并有与之相配套的综合服务功能，使其达到金色家园标准。 目前全省已设立“金色家园”养老试点单位69家。2018年底，制定了《河南省“金色家园”养老示范单位标准（试行）》，下一步将从“金色家园”试点单位中评选出示范单位为老同志提供全方位、高质量服务。通过创建达标活动，进一步提升“金色家园”的品牌影响力和示范引领作用。','','/pc/product/1',1,'','/files/0b46b257-72bf-4848-8e1f-f0edf3740523.jpg','',1,1,NULL,NULL),(2,'金色梦舞台','金色梦舞台','“金色梦舞台”主要展示老同志的丰富阅历，学习老同志的人生经验，汲取老同志的宝贵智慧。以中华优秀传统文化引导人、教育人、激励人，传承中华民族尊老敬老传统美德，培育和践行社会主义核心价值观。坚持正能量，弘扬主旋律提振精神、凝聚人心，促进家庭和睦、社会和谐。自首播以来，已制播251期，访谈嘉宾550多人次，亿万多人次收看，栏目受到广大观众特别是老同志的广泛赞誉。\r\n播出时间：河南卫视每周日上午8:17首播，每周一上午8:17重播\r\n网络视频：河南大象网“河南卫视频道”同步直播\r\n登陆“孝敬网”点击“金色梦舞台视频”收看','','/pc/product/2',2,'','/files/408639b9-6f4d-4a5a-8796-559cb95f8079.jpg','',2,1,'2019-09-12 06:21:55',0),(3,'金色大讲堂','金色大讲堂','为进一步传承中华民族尊老敬老传统美德，弘扬中华优秀传统文化，倡导孝亲敬老理念，2013年5月，总会创办了《金色大讲堂》高端讲坛栏目，与河南民生频道联合录制播出，共录制播出135期。每月举办现场报告会，先后邀请国家司法部原部长高昌礼，国家民政部原副部长李宝库，中央党校教授、博士生导师刘余莉，山东孔子礼仪文化学校校长金辉，著名传统文化导师、心理学家智然，中国老龄事业发展基金会孝文化传播委员会副主任吕明晰，传统文化名家马仙蕊、王弘錡、靳雅佳、聂振弢、颜景松、闫合作，中医科学院博士彭鑫、董峰，南京中医药大学教授郭立中等一大批重量级名家学者现场授课。省级老领导、总会领导和广大老同志积极参加大讲堂报告会。金色大讲堂聚集了中国优秀传统文化的名家大家授课，理论水平高、讲课生动深刻、内容丰富、感染力强、吸引和教育感动了现场观众和社会各界人士，大家争相参与现场听课和收看电视节目......','','/pc/product/3',3,'','/files/d803a087-6171-4450-ac47-7092b2d9c306.jpg','',NULL,1,'2019-09-12 06:25:30',0),(4,'金色管家培训','金色管家','河南金色管家职业培训学校是经河南省人力资源和社会保障厅批准、河南省民政厅注册，由河南省敬老助老总会利用非国家财政性经费，于2013年8月成立的职业培训学校。学校在全省率先开展“金色管家”职业培训，旨在培养社会急需的专业复合型养老人才。学校自成立以来，以大中专院校毕业生、4050人员、初高中毕业生、下岗失业人员为培训对象，以公共基础课程和专业技能课程为主要培训内容，通过规范、系统、专业的理论学习和实践操作，培训集传统文化、礼仪礼节、家庭保洁、家庭烹饪、陪伴照料、保健按摩、刮痧拔罐、等多种服务技能为一体的专业复合型养老服务人员——“金色管家”。截至目前，已举办金色管家初级培训班5期，累计参加培训722人。为老龄化社会输送高素质工作队伍，并有效解决就业难问题，在养老服务与需要就业人员之间架起沟通桥梁。为破解我省养老服务困局，做出了积极贡献。','','/pc/product/4',4,'','/files/9bca55b8-88ca-46a2-bb48-0c61c320089b.jpg','',2,1,'2019-09-12 06:29:24',0),(5,'金色经典歌会','经典歌会','金色经典歌会——丰富老年文化生活。为活跃老同志的精神文化生活，凝聚思想，增进感情，陶冶情操，2014年年初，总会创新形式，以唱歌培训班为载体，坚持每周四下午在省老干部活动中心举办金色经典歌会，现已累计举办329（截止到6月11日）期，参加人数达5万余人次。2016年敬老月期间，精心组织了以“弘扬长征精神传承红色记忆”为主题的纪念长征胜利80周年大型金色经典歌会，在社会产生了积极反响。由于参加歌会的老同志人数与日俱增，2017年3月，又增设了以厅级离退休老同志为主的金色经典歌会活动班，增加了八段锦、佳木斯健身操、服饰表演等内容。歌会活动不仅让老同志联络了感情，增进了友谊，而且凝聚了人心，陶冶了情操，锻炼了身体，提升了气质，充实了老同志的精神文化生活。每周按时制作“金色经典歌会”活动班集锦，让因故无法参加的老同志也能观看本周教学内容。今年还拟组建金色老年艺术团，下设合唱、模特、朗诵、戏曲分团，排练节目，到社区、养老场所慰问老同志。进一步丰富老同志的晚年生活。','艺术团','/pc/product/5',5,'金色经典歌会——丰富老年文化生活。为活跃老同志的精神文化生活，凝聚思想，增进感情，陶冶情操，2014年年初，总会创新形式，以唱歌培训班为载体，坚持每周四下午在省老干部活动中心举办金色经典歌会，现已累计举办329（截止到6月11日）期，参加人数达5万余人次。2016年敬老月期间，精心组织了以“弘扬长征精神传承红色记忆”为主题的纪念长征胜利80周年大型金色经典歌会，在社会产生了积极反响。由于参加歌会的老同志人数与日俱增，2017年3月，又增设了以厅级离退休老同志为主的金色经典歌会活动班，增加了八段锦、佳木斯健身操、服饰表演等内容。歌会活动不仅让老同志联络了感情，增进了友谊，而且凝聚了人心，陶冶了情操，锻炼了身体，提升了气质，充实了老同志的精神文化生活。每周按时制作“金色经典歌会”活动班集锦，让因故无法参加的老同志也能观看本周教学内容。今年还拟组建金色老年艺术团，下设合唱、模特、朗诵、戏曲分团，排练节目，到社区、养老场所慰问老同志。进一步丰富老同志的晚年生活。','/files/4668fa57-54a3-408f-a135-acf2277c9127.jpg','',2,1,'2019-09-12 06:44:04',0),(6,'金色助老志愿服务','金色助老志愿服务','金色助老志愿服务是总会联合部分省直单位、大专院校和社会爱心人士开展的社会公益项目。主要任务是组建“组建助老志愿服务”队伍，发挥助老志愿者骨干和专家的优势和作用，并建立常态助老志愿服务团队，为高龄、空巢等有特殊困难的老年人提供爱心帮扶、亲情陪伴、思想疏导等助老服务，同时为总会开展的大型助老活动提供志愿服务。','','/pc/product/6',6,'','/files/c3cc4520-1b29-486f-97c4-a358e9c64063.jpg','',1,1,'2019-09-12 07:37:22',0),(7,'金色大健康信息咨询服务','金色大健康信息咨询服务','金色大健康是为了应对老龄化严峻形势带来的诸多健康、无人照料等老年问题，关注各类影响健康的危险因素和误区，对老同志全面呵护搭建的服务平台。金色大健康有助于提高老同志健康素养，接受科学的健康指导和理性的健康消费，倡导一种健康的生活方式。让老同志不仅是‘治病’，更是‘治未病’，消除亚健康、提高身体素质。其中包含金色健康信息咨询服务，组织建立专家信息和老年健康信息库，利用网络信息技术，建设河南金色健康信息咨询服务平台，努力为老同志看病就医、健康管理等提供智能化服务。','','javascript:alert(\'正在建设敬请期待\')',7,'','/files/dacfd7fa-e800-4ec9-a488-3d050b690049.jpg','',NULL,1,'2019-09-12 07:45:43',0),(8,'金色社区服务','金色社区','金色社区服务主要是整合利用现有资源，集聚社会多方力量，在老同志居住相对集中的社区，指导帮助完善为老服务功能，提升为老服务能力。持续深化100个省级示范和试点社区的指导帮扶工作，规范金色社区服务管理，以点带面，将金色家园延伸至社区，推广居家养老、社区养老试点经验，组织金色梦舞台、金色大讲堂、金色经典歌会和开展金色社区健身操培训进社区活动，为老同志就近学习、就近活动就近得到关心照顾、就近发挥作用提供方便。','','/pc/product/8',8,'','/files/7412c503-f0bc-430b-aee4-bef4ba910a90.jpg','',NULL,1,'2019-09-12 07:46:45',0),(9,'金色港湾','金色港湾','金色港湾是总会培育的新型养老品牌，倡导利用社会公共资源，建设集居住生活、学习娱乐、活动健身......','','/pc/product/9',9,'','/files/61389daa-8ed1-4df5-8d8f-33a8be26c306.jpg','',NULL,1,'2019-09-12 07:48:32',0),(10,'金色老年旅行社','旅行社','金色老年旅行社是为老同志提供专业化旅游服务的团体。为丰富广大离退休老同志的精神文化生活，本着方便老同志外出旅行的目的，根据老同志实际需求，精心设计路线，科学安排行程，为老同志出行旅游提供专业化、个性化的贴心服务。金色老年旅行社是为老同志提供专业化旅游服务的团体。为丰富广大离退休老同志的精神文化生活，本着方便老同志外出旅行的目的，根据老同志实际需求，精心设计路线，科学安排行程，为老同志出行旅游提供专业化、个性化的贴心服务。','线路','javascript:alert(\'正在建设敬请期待\')',10,'为活跃老同志的精神文化生活，凝聚思想，增进感情，陶冶情操，2014年年初，总会创新形式，以唱歌培训班为载体，坚持每周四下午在省老干部活动中心举办金色经典歌会，现已累计举办329（截止到6月11日）期，参加人数达5万余人次。2016年敬老月期间，精心组织了以“弘扬长征精神传承红色记忆”为主题的纪念长征胜利80周年大型金色经典歌会，在社会产生了积极反响。由于参加歌会的老同志人数与日俱增，2017年3月，又增设了以厅级离退休老同志为主的金色经典歌会活动班，增加了八段锦、佳木斯健身操、服饰表演等内容。歌会活动不仅让老同志联络了感情，增进了友谊，而且凝聚了人心，陶冶了情操，锻炼了身体，提升了气质，充实了老同志的精神文化生活。每周按时制作“金色经典歌会”活动班集锦，让因故无法参加的老同志也能观看本周教学内容。今年还拟组建金色老年艺术团，下设合唱、模特、朗诵、戏曲分团，排练节目，到社区、养老场所慰问老同志。进一步丰富老同志的晚年生活。','/files/7512a72e-e5c4-44dc-93f5-c268f7eecff2.jpg','',NULL,1,'2019-09-12 07:49:57',0);

/*Table structure for table `sys_dept` */

DROP TABLE IF EXISTS `sys_dept`;

CREATE TABLE `sys_dept` (
  `dept_id` bigint(20) NOT NULL AUTO_INCREMENT,
  `parent_id` bigint(20) DEFAULT NULL COMMENT '上级ID，一级为0',
  `name` varchar(50) DEFAULT NULL COMMENT '架构名称',
  `order_num` int(11) DEFAULT NULL COMMENT '排序',
  `del_flag` tinyint(4) DEFAULT '0' COMMENT '是否删除  -1：已删除  0：正常',
  PRIMARY KEY (`dept_id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='部门管理';

/*Data for the table `sys_dept` */

insert  into `sys_dept`(`dept_id`,`parent_id`,`name`,`order_num`,`del_flag`) values (6,0,'总平台',1,1),(16,0,'家园',42,1);

/*Table structure for table `sys_dict` */

DROP TABLE IF EXISTS `sys_dict`;

CREATE TABLE `sys_dict` (
  `id` bigint(64) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `name` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '标签名',
  `value` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '数据值',
  `type` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '类型',
  `description` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `sort` decimal(10,0) DEFAULT NULL COMMENT '排序（升序）',
  `parent_id` bigint(64) DEFAULT '0' COMMENT '父级编号',
  `create_by` int(64) DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` bigint(64) DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '删除标记',
  PRIMARY KEY (`id`),
  KEY `sys_dict_value` (`value`),
  KEY `sys_dict_label` (`name`),
  KEY `sys_dict_del_flag` (`del_flag`)
) ENGINE=InnoDB AUTO_INCREMENT=123 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='字典表';

