/*Table structure for table `sys_setup` */

DROP TABLE IF EXISTS `sys_setup`;

CREATE TABLE `sys_setup` (
  `id` int(1) NOT NULL AUTO_INCREMENT,
  `corporate_name` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '公司名称',
  `address` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '地址',
  `telephone` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `official_account` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '公众号二维码',
  `app_qr_code` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'app二维码',
  `online_code` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '网络大学二维码',
  `direct` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '主办',
  `record_number` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备案信息',
  `copyright` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '版权信息',
  `copyright_information` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '客服微信二维码',
  `introduction_img` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '总会简介展示图',
  `company_introduction` text COLLATE utf8_bin COMMENT '总会简介',
  `home_installation` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '家园配套设施',
  `community_installation` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '社区配套设施',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='网站配置';

/*Data for the table `sys_setup` */

insert  into `sys_setup`(`id`,`corporate_name`,`address`,`telephone`,`official_account`,`app_qr_code`,`online_code`,`direct`,`record_number`,`copyright`,`copyright_information`,`introduction_img`,`company_introduction`,`home_installation`,`community_installation`) values (1,'河南沙浪科技','河南省郑州市地德街16号河南省老干部活动中心','13027739565','/files/7a1449c0-e775-4157-b67b-627909cebaca.jpg','/files/7a1449c0-e775-4157-b67b-627909cebaca.jpg','/files/7a1449c0-e775-4157-b67b-627909cebaca.jpg','河南沙浪科技','1',NULL,'','/files/ed939ba4-343f-4cfd-9413-542e07d9fca9.jpg','<p><font color=\"#333333\">河南省敬老助老总会（以下简称总会）是归省委老干部局主管，经省民政厅批准的公益性社团组织，自2012年成立以来，认真按照习近平总书记关于“积极应对人口老龄化，大力发展老龄服务事业和产业”重要指示精神，秉承“尊老、敬老、爱老、助老”宗旨，着力替党委政府分忧，为老同志解难,扎实推进“金色助老工程”十大金色品牌项目，得到了省委省政府的充分肯定，赢得了社会各界及广大老同志的广泛赞誉，有力服务了全省工作大局，促进了社会和谐稳定，为河南乃至全国老龄事业发展探索了新路子，积累了新经验。</font></p><p><font color=\"#333333\">总会连续四年被省财政厅、省民政厅、省国税局、省地税局评定为“公益性社团组织”；2016年6月获得省民政厅授予的“全省先进社会组织”称号；2016年12月获得全国老龄委授予的“敬老文明号”荣誉称号；2017年7月获得省委老干部局授予的“先进社团”称号。</font></p><p><font color=\"#333333\">总会精心打造“金色助老工程”十大金色品牌项目——金色家园、金色梦舞台、金色大讲堂、金色管家、金色经典歌会、金色助老志愿服务、金色社区服务、金色大健康信息咨询服务、金色港湾、金色老年旅行社。十大金色品牌项目统筹运作，同步推进，涉及养老场所建设、养老服务人员培训、传统文化传播等诸多方面，各个项目既紧密联系，又各具特色，既有顶层设计，又有基础支撑，在我省乃至全国涉老领域颇具开拓性、创新性和超前性，得到中组部和省委、省政府领导的高度评价，受到社会各界的广泛关注和好评。</font></p><p><font color=\"#333333\">总会将进一步增强机遇意识、创新意识、服务意识和忧患意识，不忘初心、牢记使命，紧跟时代步伐，充分发挥公益社会组织的积极作用，竭诚与社会各界爱心人士携起手来，以大爱之心、大孝之情，为全省乃至全国老龄事业发展发挥引领和示范作用，为决胜全面建成小康社会、让中原更加出彩，让老同志金色岁月更加璀璨，努力作出新的更大的贡献！</font></p>',NULL,NULL);

/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `user_id` int(20) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) DEFAULT NULL COMMENT '用户名',
  `name` varchar(100) DEFAULT NULL,
  `password` varchar(50) DEFAULT NULL COMMENT '密码',
  `dept_id` bigint(20) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `mobile` varchar(100) DEFAULT NULL COMMENT '手机号',
  `status` tinyint(255) DEFAULT NULL COMMENT '状态 0:禁用，1:正常',
  `user_id_create` int(255) DEFAULT NULL COMMENT '创建用户id',
  `gmt_create` datetime DEFAULT NULL COMMENT '创建时间',
  `gmt_modified` datetime DEFAULT NULL COMMENT '修改时间',
  `sex` int(32) DEFAULT NULL COMMENT '性别',
  `birth` datetime DEFAULT NULL COMMENT '出身日期',
  `pic_id` bigint(32) DEFAULT NULL,
  `live_address` varchar(500) DEFAULT NULL COMMENT '现居住地',
  `hobby` varchar(255) DEFAULT NULL COMMENT '爱好',
  `province` varchar(255) DEFAULT NULL COMMENT '省份',
  `city` varchar(255) DEFAULT NULL COMMENT '所在城市',
  `district` varchar(255) DEFAULT NULL COMMENT '所在地区',
  PRIMARY KEY (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

