/*Table structure for table `system_article` */

DROP TABLE IF EXISTS `system_article`;

CREATE TABLE `system_article` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '自增编号',
  `article_title` varchar(20) NOT NULL COMMENT '标题',
  `author` varchar(20) DEFAULT NULL COMMENT '作者',
  `source` varchar(20) DEFAULT NULL COMMENT '来源',
  `article_title_image` varchar(255) DEFAULT NULL COMMENT '封面图',
  `url` varchar(255) DEFAULT NULL COMMENT '链接',
  `introduce` text COMMENT '简介',
  `article_content` text COMMENT '内容',
  `type` int(20) DEFAULT NULL COMMENT '1:导航 2:服务类型',
  `art_type` int(10) DEFAULT NULL COMMENT '文章类型 1:管家动态 2:歌会动态3志愿者服务动态 4全国 5河南省 6春节慰问 7重阳节活动 8文艺活动 9调研活动',
  `relevance_id` int(20) DEFAULT NULL COMMENT '关联编号ID',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '变更时间',
  `release_time` datetime DEFAULT NULL COMMENT '文章发布时间',
  `commit_time` datetime DEFAULT NULL COMMENT '结束时间',
  `is_publish` int(20) DEFAULT NULL COMMENT '是否发布 0:未发布 1:已发布',
  `is_delete` int(20) DEFAULT NULL COMMENT '是否删除 0:未删除 1:已删除',
  `is_display` int(20) DEFAULT NULL COMMENT '是否隐藏文章0:不隐藏 1:隐藏',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='系统文章';

