insert  into `system_article`(`id`,`article_title`,`author`,`source`,`article_title_image`,`url`,`introduce`,`article_content`,`type`,`art_type`,`relevance_id`,`create_time`,`update_time`,`release_time`,`commit_time`,`is_publish`,`is_delete`,`is_display`) values (8,'总会简介','王','河南敬老协会','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'河南省敬老助老总会','<p>河南省敬老助老总会（以下简称总会）是归省委老干部局主管，经省民政厅批准的公益性社团组织，自2012年成立以来，认真按照习近平总书记关于“积极应对人口老龄化，大力发展老龄服务事业和产业”重要指示精神，秉承“尊老、敬老、爱老、助老”宗旨，着力替党委政府分忧，为老同志解难,扎实推进“金色助老工程”十大金色品牌项目，得到了省委省政府的充分肯定，赢得了社会各界及广大老同志的广泛赞誉，有力服务了全省工作大局，促进了社会和谐稳定，为河南乃至全国老龄事业发展探索了新路子，积累了新经验。</p><p>总会连续四年被省财政厅、省民政厅、省国税局、省地税局评定为“公益性社团组织”；2016年6月获得省民政厅授予的“全省先进社会组织”称号；2016年12月获得全国老龄委授予的“敬老文明号”荣誉称号；2017年7月获得省委老干部局授予的“先进社团”称号。</p><p>总会精心打造“金色助老工程”十大金色品牌项目——金色家园、金色梦舞台、金色大讲堂、金色管家、金色经典歌会、金色助老志愿服务、金色社区服务、金色大健康信息咨询服务、金色港湾、金色老年旅行社。十大金色品牌项目统筹运作，同步推进，涉及养老场所建设、养老服务人员培训、传统文化传播等诸多方面，各个项目既紧密联系，又各具特色，既有顶层设计，又有基础支撑，在我省乃至全国涉老领域颇具开拓性、创新性和超前性，得到中组部和省委、省政府领导的高度评价，受到社会各界的广泛关注和好评。</p><p>总会将进一步增强机遇意识、创新意识、服务意识和忧患意识，不忘初心、牢记使命，紧跟时代步伐，充分发挥公益社会组织的积极作用，竭诚与社会各界爱心人士携起手来，以大爱之心、大孝之情，为全省乃至全国老龄事业发展发挥引领和示范作用，为决胜全面建成小康社会、让中原更加出彩，让老同志金色岁月更加璀璨，努力作出新的更大的贡献！</p><p><br/></p>',1,NULL,2,'2019-10-11 02:30:42',NULL,NULL,NULL,NULL,0,NULL),(19,'金色管家培训','金色管家培训','金色管家培训','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'金色管家培训','<p><span style=\"color: rgb(103, 106, 108); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 14px; background-color: rgb(243, 243, 244);\">金色管家培训</span></p>',2,1,4,'2019-10-14 08:43:24',NULL,NULL,NULL,NULL,0,NULL),(20,'金色经典歌会','金色经典歌会','金色经典歌会','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'金色经典歌会','<p><span style=\"color: rgb(103, 106, 108); font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif; font-size: 14px; background-color: rgb(249, 249, 249);\">金色经典歌会</span></p>',2,2,5,'2019-10-14 08:43:59',NULL,NULL,NULL,NULL,0,NULL),(21,'	金色助老志愿服务','	金色助老志愿服务','	金色助老志愿服务','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'	金色助老志愿服务','<table id=\"exampleTable\" data-mobile-responsive=\"true\" class=\"table table-hover table-striped\" width=\"1131\" style=\"width: 705px;\"><tbody style=\"box-sizing: border-box;\"><tr data-index=\"5\" style=\"box-sizing: border-box; background-color: rgb(245, 245, 245);\" class=\"firstRow\"><td style=\"box-sizing: border-box; margin: 0px; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); vertical-align: middle; border-left-color: rgb(228, 234, 236); line-height: 1.42857; border-top-color: rgb(231, 234, 236); padding: 8px !important;\">金色助老志愿服务</td></tr></tbody></table><p><br/></p>',2,3,6,'2019-10-14 08:44:20',NULL,NULL,NULL,NULL,0,NULL),(22,'老龄政策-全国','老龄政策-全国','老龄政策-全国','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'老龄政策-全国','<p>老龄政策-全国</p>',1,4,7,'2019-10-14 08:45:19',NULL,NULL,NULL,NULL,0,NULL),(23,'老龄政策-河南省','老龄政策-河南省','老龄政策-河南省','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'老龄政策-河南省','<p>老龄政策-河南省</p>',1,5,7,'2019-10-14 08:45:36',NULL,NULL,NULL,NULL,0,NULL),(24,'	助老活动-春节慰问','	助老活动-春节慰问','	助老活动-春节慰问','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'	助老活动-春节慰问','<p><span style=\"white-space: pre;\">	</span>助老活动-春节慰问</p>',1,6,8,'2019-10-14 08:45:58',NULL,NULL,NULL,NULL,0,NULL),(25,'	助老活动-重阳节活动','	助老活动-重阳节活动','	助老活动-重阳节活动','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'	助老活动-重阳节活动','<p><span style=\"white-space: pre;\">	</span>助老活动-重阳节活动</p>',1,7,8,'2019-10-14 08:46:19',NULL,NULL,NULL,NULL,0,NULL),(26,'	助老活动-文艺活动','	助老活动-文艺活动','	助老活动-文艺活动','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'	助老活动-文艺活动','<p><span style=\"white-space: pre;\">	</span>助老活动-文艺活动</p>',1,8,8,'2019-10-14 08:46:33',NULL,NULL,NULL,NULL,0,NULL),(27,'	助老活动-调研活动','	助老活动-调研活动','	助老活动-调研活动','/files/492c85a7-c406-4f25-bdf1-b399d7a69829.jpg',NULL,'	助老活动-调研活动','<p><span style=\"white-space: pre;\">	</span>助老活动-调研活动</p>',1,9,8,'2019-10-14 08:46:48',NULL,NULL,NULL,NULL,0,NULL),(28,'老年期刊第一期',