/*Table structure for table `vol_team` */

DROP TABLE IF EXISTS `vol_team`;

CREATE TABLE `vol_team` (
  `id` int(20) NOT NULL AUTO_INCREMENT,
  `team_id` int(20) DEFAULT NULL COMMENT '团队id',
  `name` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '志愿者团队名称',
  `url` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '照片',
  `content_service` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '服务内容',
  `year_service` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '服务年限',
  `addres_service` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '详细地址',
  `tel` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '电话',
  `job_vol` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '团队职能',
  `reg_code` bigint(20) DEFAULT NULL COMMENT '地区code',
  `reg_name` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '服务地点',
  `status` int(20) DEFAULT NULL COMMENT '1:申请中 2:申请通过 3:拒绝 ',
  `presen_service` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '服务介绍(保留字段)',
  `sort` int(20) DEFAULT NULL COMMENT '排序(保留字段)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='志愿者信息';

